package com.lhw.mvc3;

public class MyBean {

	private int xx;
	private int yy;
	private int hab;
	private int cha;
	private int gob;
	private int moks;
	
	public MyBean() {
		// TODO Auto-generated constructor stub
	}

	public MyBean(int xx, int yy, int hab, int cha, int gob, int moks) {
		super();
		this.xx = xx;
		this.yy = yy;
		this.hab = hab;
		this.cha = cha;
		this.gob = gob;
		this.moks = moks;
	}

	public int getXx() {
		return xx;
	}

	public void setXx(int xx) {
		this.xx = xx;
	}

	public int getYy() {
		return yy;
	}

	public void setYy(int yy) {
		this.yy = yy;
	}

	public int getHab() {
		return hab;
	}

	public void setHab(int hab) {
		this.hab = hab;
	}

	public int getCha() {
		return cha;
	}

	public void setCha(int cha) {
		this.cha = cha;
	}

	public int getGob() {
		return gob;
	}

	public void setGob(int gob) {
		this.gob = gob;
	}

	public int getMoks() {
		return moks;
	}

	public void setMoks(int moks) {
		this.moks = moks;
	}
	
	

}
